if ($psISE.Options.AutoSaveMinuteInterval -ne $null){    

# Don't copy these value into the BPS action, it will take a long time or even kill it.
    $content = "" 
    $attachmentName = "Newtonsoft.json.dll"
    $targetServers = "server1"
    $isLocalMachineAccount = $true    
    $username = Read-Host -Prompt "Provide user name"
    $password = Read-Host -Prompt "Enter password"      
}

# we are not using else, so that we can copy everything below to the designer studio action.
# mapping BPS field values outside the {} so that they will be assigned, otherwise they won't be replaced.
$devServers = "{1962}"
$testServers = "{1969}"
$prodServers = "{1970}"
$fileContent = "{1967}"
if ($psISE.Options.AutoSaveMinuteInterval -eq $null){   
    $content = $fileContent 
    $attachmentName = "{BRD:1599}"
    if (${BRD:39}){$targetServers = $devSErvers}
    if (${BRD:40}){$targetServers = $testServers }
    if (${BRD:41}){$targetServers = $prodServers }
    $isLocalMachineAccount = $false
}

Add-Type -AssemblyName System.DirectoryServices.AccountManagement
if ($isLocalMachineAccount){
    $obj = New-Object System.DirectoryServices.AccountManagement.PrincipalContext([System.DirectoryServices.AccountManagement.ContextType]::Machine)
}
else{
    $obj = New-Object System.DirectoryServices.AccountManagement.PrincipalContext([System.DirectoryServices.AccountManagement.ContextType]::Domain,$env:USERDNSDOMAIN)
}
if (!$obj.ValidateCredentials($username, $password) )
{
    throw "Password for user '$username' is not valid. Multiple calls with a wrong password may lock your account!!"
}


$cred=New-Object System.Management.Automation.PSCredential -ArgumentList @($username,(ConvertTo-SecureString -String $password -AsPlainText -Force))
$servers = [array]$targetServers.Split(",")
foreach ($server in $servers){
    #$server = $servers[0]
    Write-Output "Processing server '$server' `r`n"
    Invoke-Command -Credential $cred -ComputerName $server -ArgumentList @($attachmentName,$content,$username)  -ScriptBlock  {  param($attachmentName,$fileContent,$username) 
            $ErrorActionPreference = "Stop"
            $currentPrincipal = New-Object Security.Principal.WindowsPrincipal([Security.Principal.WindowsIdentity]::GetCurrent())
            if (!$currentPrincipal.IsInRole([Security.Principal.WindowsBuiltInRole]::Administrator)){
                throw "User '$username' is not an admin on server '$env:computername'"
            }        
            $targetFolder = "$env:TEMP\BPS_GacDeployment\$($attachmentName)_$((Get-date).ToString("s").Replace(":",''))"
            $targetFilePath = "$targetFolder\$attachmentname" 
            $targetDebugFilePath = "$targetFolder\$($attachmentname).txt" 
            Write-Output "Creating temp folder 'targetFolder' on server '$env:computername' `r`n"        
            New-Item -Path $targetFolder -Force -ItemType Directory
        
            Write-Host "Writing file: $targetFilePath"
            Set-Content -value $fileContent1 -Path $targetDebugFilePath 
            $byteContent = [System.Convert]::FromBase64String($fileContent)                
            Set-Content -Value $byteContent -Path $targetFilePath -Encoding Byte

            [void][System.Reflection.Assembly]::Load("System.EnterpriseServices, Version=4.0.0.0, Culture=neutral, PublicKeyToken=b03f5f7f11d50a3a")            
            $publish = New-Object System.EnterpriseServices.Internal.Publish 
            if (${1952}) {
                Write-Output "Installing assembly '$targetFilePath' on server '$env:computername' `r`n"
                $publish.GacInstall($targetFilePath)
            } else {
                Write-Output "Installing assembly '$targetFilePath' on server '$env:computername' `r`n"
                $publish.GacRemove($targetFilePath)
            }
            Write-Output "Removing temp folder '$targetFolder'"        
            Remove-Item -Path $targetFolder -Force -Recurse
    }
}